insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125385, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000070, 'Авторизация получила этот статус, когда она была расходирована. Причина статуса может указывать исходное событие для расхолдирования.')
