insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125386, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000265, 'Импортировано, ожидает обработки')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125387, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000265, 'Авторизация получает этот статус во время процесса загрузки из фронтальной подсистемы в зависимости от кода ответа после проверки всех данных, или во время перепроверки данных после коррекции.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125388, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000266, 'Обработано')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125389, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000266, 'Авторизация получает этот статус, когда успешно обработана, и не требуется никаких дальнейших действий.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125390, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000267, 'Ошибка в данных, ожидает ручной коррекции')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125391, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000267, 'Авторизация получает этот статус во время процесса импорта из фронтальной системы или перепроверке данных, когда некоторые из данных не прошли ее. Поле причина статуса содержит фактический источник ошибки.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125392, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000268, 'Ошибка обработки')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125393, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000268, 'Этот статус означает, что некоторые ошибки во время обработки разрешения. Статус поле причине или процесс журналов можно указать точный источник ошибки.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125394, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000269, 'Обработка пропущена')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125395, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000269, 'Разрешение получает этот статус, когда Есть никаких действий (правила) была применена во время обработки. Этот случай может означать, ошибки в обработке конфигурации.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125396, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000270, 'Схлопнута')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125397, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000270, 'Этот статус получает разворота (и может быть оригинал разрешения в случае полного разворота), когда он рассматривался как компенсация оригинал разрешения.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125398, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000271, 'Не требует обработки')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125399, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000271, 'Разрешение получает этот статус во время процесса импорта из интерфейса системы или по запросу оператора, когда он был импортирован для ручной обработки.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125400, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000272, 'Заморожена для ручной обработки')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125401, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000272, 'Авторизация можете получить этот статус во время процесса импорта из интерфейса системы в зависимости от кода ответа".')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125402, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000274, 'Обработано, ожидает расхолдирования')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125403, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000274, 'Разрешение получает этот статус, когда она была успешно обработана и нуждаются в дальнейшей unholded')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125404, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000275, 'Заморожена до активации карты')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125405, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000275, 'Разрешение получает этот статус в процессе обработки, когда карты, участвующих в операции wasn''t активирован')
