insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125406, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10000279, 'Представление обработано')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000125407, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10000279, 'Авторизация получает этот статус, если она приходит уже после того как представление было обработано.')
