/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129747, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10001040, 'Контрольный ключ карты (CVK)')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129748, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001041, 'CVK2 используется для генерации и проверки данных карты и владельца, т.е. CVV2.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129749, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10001041, 'Контрольный ключ карты 2 (CVK2)')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129750, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001039, 'Последовательность ключей, которая используется для преобразования шестнадцатеричного значения в десятичное. Децимилизационные таблицы могут быть сохранены в пользовательском месте хранения и использоваться так же, как ключи. Децимилизационная таблица из 16 цифр должна содержать не менее 8 различных цифр, без цифр встречающихся чаще чем 4 раза. Децимилизационная таблица используется в качестве входных данных для генерации PIN-офсета.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129751, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10001039, 'Децимилизационная таблица')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129752, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001047, 'IMKac используется для проверки данных EMV во время обработки транзакции. Он используется для проверки APQC (криптограммы, созданной на стороне терминала) и генерировать ARPC (криптограмма хоста). Ключ генерируется в процессе выпуска карты.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129753, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10001047, 'Эмитентский мастер-ключ для прикладного шифрования')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129754, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001030, 'PEK транспортный ключ использован для передачи PIN-кода в PIN блок из програмного обеспечения генерации данных карты в эмбоссер. Он используется для шифрования PIN-кода в файл для эмбоссера. Этот ключ должен быть известен на стороне эмбоссера.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129755, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001033, 'PVK используется для генерации и проверки данных PIN-кода (PVV, PIN-смещение) и, таким образом, проверить подлинность PIN-кода. Использование PVK может изменяться в соответствии с различными методами проверки PIN-кода. Для методов VISA можно иметь до 7 PVK. Для IBM3624 метод PVK используется с таблицей децимилизации.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129756, 'LANGRUS', NULL, 'COM_DICTIONARY', 'NAME', 10001033, 'Ключ проверки PIN-кода')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000129757, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001046, 'TAK используется для генерации Message Authentication Code (MAC) для сообщений, которые передаются от терминала до хоста или наоборот. TAK также использоваться для проверки MAC. ТАК должен быть известен обеим сторонам взаимодействия.')
/
