insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000131167, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001043, 'TMK терминальный ключ, используемый для передачи других ключей (TPK, TAK) между терминалом и хостом в случае смены ключей. TMK хранится на обеих сторонах обмена. TMK для TPK используется в случае если терминал использует раздельные мастер-ключи для шифрования ключей разных типов. В этом случае специальный TMK для передачи TPK используется вместо обычного TMK ключа, чтобы передать TPK ключи.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000131168, 'LANGRUS', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001044, 'TMK терминальный ключ, используемый для передачи других ключей (TPK, TAK) между терминалом и хостом в случае смены ключей. TMK хранится на обеих сторонах обмена. TMK для TAK используется в случае если терминал использует раздельные мастер-ключи для шифрования ключей разных типов. В этом случае специальный TMK для передачи TAK используется вместо обычного TMK ключа, чтобы передать TAK ключи.')
/
