insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043765, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000065, 'Карты с авторизациями, на которые были получены ответы с подтверждением или ответы с отказом (в один и более этапов со снижением суммы авторизации), с указанием процента, который составляет сумма обработанной авторизации/авторизаций от первично заявленной суммы авторизации')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043766, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000066, 'Отчет содержит список номеров карт, по которым процент авторизаций с ручным вводом превышает порог, заданный параметром')
