insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043767, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000067, 'Отчет содержит список номеров карт, по которым среднесуточный процент использования доступного остатка за день больше значения, заданного параметром')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043768, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000068, 'Отчет содержит основные параметры карт, выпущенных за указанный пользователем период. Информация о картах сгруппирована по агентам')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043769, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000069, 'Отчет содержит информацию о выпущенных картах, направляемых в подразделение')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043770, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000070, 'Отчет содержит информацию о ПИН-конвертах, направляемых подразделению')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043771, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000071, 'Отчет содержит суммарные значения захолдированных сумм по всем счетам института в каждой валюте на момент получения отчета')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043772, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000072, 'Отчет содержит основные параметры выпущенных карт. Информация о картах сгруппирована по компаниям. В отчет попадают, в том числе и карты, не относящиеся к компаниям')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043773, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000074, 'Отчет содержит информацию о картах, срок действия которых заканчивается в заданный пользователем период. Помимо основных параметров карты, в отчете отображаются основные остатки (ledger balance) по карточным счетам')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043774, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000076, 'Отчет содержит средние остатки (ledger balance) и средние суммы транзакций по счетам клиентов/держателей карт за заданный период ')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043775, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000079, 'Отчет содержит остаткви средств по карточным счетам, открытым в отделениях и филиалах банка. Он содержит остатки на счетах по всем картам института на момент получения отчета')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043776, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000080, 'Отчёт о картах, подлежащих обнулению и последующему удалению. Он содержит информацию по картам и привязанным к ним счетам, для которых выполняются следующие условия: -срок действия карты заканчивается в заданный пользователем период; -карта действительна, т.е. имеет статус ACTIVE; -на момент получения отчета карточный счет имеет ненулевой основной остаток (ledger balance)')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043777, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000081, 'Отчет содержит перечень карт, перевыпущенных за заданный пользователем период, а также основные параметры привязанных к ним счетов')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043778, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000082, 'В отчете отображаются карты, удовлетворяющие условиям:  1. карта действительна, т.е. имеет статус ACTIVE; 2. все счета, привязанные к карте, имеет нулевые основные остатки (ledger balance); 3. срок действия карты находится в заданном пользователем периоде')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043779, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000083, 'В отчете отображаются карты и привязанные к ним счета, имеющие овердрафт  на момент получения отчета')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043780, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000084, 'Отчёт о корпоративных картах банка, подлежащих пополнению. В отчет попадают карты, принадлежащие корпоративным клиентам')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043781, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000085, 'Отчет содержит сумму исходящих основных остатков (ledger balance) по всем карточным счетам на конец заданного пользователем операционного дня')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000043782, 'LANGRUS', NULL, 'RPT_REPORT', 'DESCRIPTION', 10000086, 'В отчете отражаются остатки (ledger balance и overdraft amount) по счетам на конец банковского дня, заданного пользователем')
/
