insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000044615, 'LANGRUS', NULL, 'RUL_PROC', 'DESCRIPTION', 1537, 'Это правило вычисляет новую сумму, используя пропорцию между двумя суммами. Иначе говоря, используется следующая формула: результат = сумма_множитель * (сумма_делимое / сумма_делитель). Это правило может быть полезно в случае, когда вам нужно перевести некую сумму из исходной валюты в конечную, но вам неизвестен курс обмена, а известна только пара сумм одного и того же достоинства, но одна из них в исходной валюте, другая - в конечной.')
